    return Date.parse(new Date(data)) / 1000;
  };
  /**
   * 冒泡排序：升序
   * @param data - tradePoint数据
   * @returns {*} - 升序排序的数据
   */
  const sortTradePoint = (data) => {
    let i = 0,j = 0;
    let temp;
    for(i = 0;i < data.length; i += 1)
      for(j = 1; j<data.length; j += 1) {
        if(timeToNum(data[i].time) > timeToNum(data[j].time)) {
          temp = data[i];
          data[i] = data[j];
          data[j] = data[i];
        }
      }
      return data;
  };
