              style: {
                circle: {
                  lineWidth: 0,
                },
                line: {
                  stroke: '#FF3232',
                  lineWidth: 1.0,
                  smooth: 0.5,
                },
              },
            },
          ],
        });

        for (i = 0; i < 1; i += 1) {
          let ctor;
          switch (i) {
            case 0:
              ctor = chart0;
              break;
//            case 1:
//              ctor = chart1;
//              break;
//            case 2:
//              ctor = chart2;
//              break;
            default:
              break;
          }
          for (let j = 0; j < seriesAmount; j += 1) {
            this.chart.addSeries(ctor([], `chart_${i}_${j}`));
          }
        }

        this.chart.loading.show();
        this.chart.on('pan', () => {
          interactionLimit.isInteracting = true;
        });
        this.chart.on('mousewheel', () => {
          interactionLimit.isInteracting = true;
        });
        window.addEventListener('resize', this.getChartArea);
      },
      /**
       * 信号点创建
       * @param data -
       * @returns {Array}
       */
      markerCreater(data) {
        const points = []; // 保存信号点位置数据
        let result = []; // 生成信号点线段点集
        const seriesLength = this.chart.getSeries('tick').points.length;
        // 风险、机会标记是用图片显示的，且是图片的base64编码
        const chancePoint = {
          x: 0,
          y: 0,
          url: chanceImg,
          width: 40,
          height: 51,
          offsetX: -20,
          offsetY: -48, // 根据图片大小调整
        };
        const riskyPoint = {
          x: 0,
          y: 0,
          url: riskyImg,
          width: 40,
          height: 51,
          offsetX: -20,
          offsetY: -48,
        };
        if (this.chart && seriesLength > 0) {
          const series = this.chart.getSeries('tick'); // 取线段点集
          baseUtil.each(data, (item, index) => {
            for (let i = 0; i < seriesLength; i += 1) {
              const seriesPoint = series.points[i];
              if (seriesPoint.date === item.time) {
                const x = seriesPoint.x; // X坐标是点的位置
                const y = seriesPoint.y; // Y坐标是现价
//                const yMax = series.displayYData[1]; // y轴最大值
                if (item.tradeType === '1') {
                  points.push(baseUtil.merge(baseUtil.copy(riskyPoint), {
                    x,
                    y,
                  }, true));

                  if(x < 70) {
                    points[index].url = riskyLeft;
                    points[index].offsetX = -4;
                  } else if(x > seriesLength - 80) {
                    points[index].url = riskyRight;
                    points[index].offsetX = - 36;
                  }
                } else if (item.tradeType === '2'){
                  points.push(baseUtil.merge(baseUtil.copy(chancePoint), {
                    x,
                    y,
                  }, true));
                  if(x < 70) {
                    points[index].url = chanceLeft;
                    points[index].offsetX = -4;
                  } else if(x > seriesLength - 80) {
                    points[index].url = chanceRight;
                    points[index].offsetX = - 36;
                  }
                } else {
                  break;
                }
                break;
              }
            }
          });
          points.sort((a, b) => a.x - b.x); // 排序，小的在前，大的在后
          if (!data || points.length === 0) { // 如果没有买卖点或者合格的买卖点数为0，则创建2410个空点
            result = result.concat(baseUtil.createArray(241 * 10, null));
          }
          let currentIndex = 0; //当前信号点index;
          for(let i = 0; i < seriesLength; i +=1) {
            // 如果是交易点，则传入交易点数据，否则传入null
            if(currentIndex < points.length && series.points[i].x === points[currentIndex].x) {
              result.push(points[currentIndex]);
              currentIndex +=1;
            } else {
              result.push(null);
            }
          }
//          baseUtil.each(points, (point, index) => {
//            const x = point.x; // 点的位置，x从0开始
//            if (points.length === 1) { // 如果只有一个买卖点
//              result = result.concat(baseUtil.createArray(x, null));
//              result.push(point);
//              result = result.concat(baseUtil.createArray(seriesLength - 1 - x, null));
//            } else if (index === points.length - 1) { // 对point的最后一个点
//              result = result.concat(baseUtil.createArray((x - points[index - 1].x) - 1, null)); // 补充长度等同points最后一个和倒数第二个之间的点数的数组
//              result.push(point); // 传入当前点
//              result = result.concat(baseUtil.createArray(seriesLength - 1 - x, null)); // 补齐之后的点
//            } else if (index === 0) { // 对point的第一个点
//              result = result.concat(baseUtil.createArray(x, null));
//              result.push(point);
//            } else {
//              result = result.concat(baseUtil.createArray((x - points[index - 1].x) - 1, null)); // 每次补充长度等同两个点之间点数的数组数
//              result.push(point);
//            }
//          });
        }
        return result;
      },
      /**
       * 收益线点集创建
       * @param data - 信号点信息
       * @returns {Array} - Y坐标集，2410个点
       */
      profitCreater(data) {
        const points = []; // 保存信号点位置数据
        let result = []; // 生成收益线段点集
        const seriesLength = this.chart.getSeries('tick').points.length;
        if (this.chart && seriesLength > 0) {
          const seriesData = this.chart.getSeries('tick').points; // 分时线点集
          // 找到每个交易点的位置
          baseUtil.each(data, (item) => {
            for (let i = 0; i < seriesLength; i += 1) {
              if (seriesData[i].date === item.time) {
                const x = seriesData[i].x; // X坐标是点的位置
                if (item.tradeType === '1') { // 风险点
                  points.push({
                    x,
                    flag: 0,
                  });
                } else if (item.tradeType === '2'){ // 机会点
                  points.push({
                    x,
                    flag: 1,
                  });
                } else { // 如果有，忽略其他类型的点
                  break;
                }
                break;
              }
            }
          });
          points.sort((a, b) => a.x - b.x); // 排序，小的在前，大的在后
          if (!data || points.length === 0) { // 如果没有买卖点或者合格的买卖点数为0，则创建2410个空点
            result = result.concat(baseUtil.createArray(241 * 10, null));
            return result;
          }
          result.push(seriesData[0].y * 1.001); // 第一个点的值
          let flag = 0; // 标记
          let currentIndex = 0; //当前信号点index;
          (points[0].flag === 1) ? flag = 0:flag = 1; // 根据第一个信号点判断初始flag值
          for(let i = 1; i < seriesLength; i +=1) {
            if(seriesData[i].y) { // 当日实时数据已有部分
              result.push(result[i-1] + (seriesData[i].y - seriesData[i-1].y) * flag);
              if(currentIndex < points.length && seriesData[i].x === points[currentIndex].x) {
                flag = points[currentIndex].flag;
                currentIndex +=1;
              }
            } else { // 当日实时数据为空的部分
              result.push(null);
            }
          }
        }
        return result;
      },
      refreshTick(data) {
        if (!this.chart) {
          return;
        }
        const chart = this.chart;
        const tick = data.line;
//        const preClose = data.preClose;
        const tradePoint = data.tradePoint; // 买卖点信息
        const yA = '_yAxis';
        const yAxis = chart.getSeries('tick')[yA];
        yAxis.max = 'auto';
        yAxis.min = 'auto';
        if (tick && tick.length) {
//          yAxis.splitLine = preClose;
          chart.getSeries('tick').setSeries(chartHandler(this.isInit, '多日分时', tick));
          if(tradePoint) {
            const profitData = this.profitCreater(tradePoint);
            chart.getSeries('profit').setSeries({
              points: profitData,
              displayRange: 'max',
            });
            const tradeData = this.markerCreater(tradePoint);
            chart.getSeries('marker').setSeries({
              points: tradeData,
              displayRange: 'max',
            });
          }
          // 如果有分时数据才刷新资金流入数据
          baseUtil.each(this.config, (name, index) => {
            const seriesName = this.typeMap[name];
            const seriesData = baseUtil.copy(data[seriesName]);
            let count = 0;
            if (seriesData) {
              // 当seriesData是数组的时候，说明只有一条线（或者柱状图），只要处理chart_*_0就可以了
              if (baseUtil.isArray(seriesData)) {
                chart.getSeries(`chart_${index}_0`).setSeries(chartHandler(this.isInit, name, seriesData));
                this.clearChart(`chart_${index}_1`, `chart_${index}_2`, `chart_${index}_3`);
              } else {
                // 当seriesData不是数组的时候，说明会有多条线，分别赋值给chart_*_[0-3]
                baseUtil.each(seriesData, (series, seriesType) => {
                  chart.getSeries(`chart_${index}_${count}`).setSeries(chartHandler(this.isInit, name, series, seriesType));
                  count += 1;
                });
                for (count; count <= 3; count += 1) {
                  this.clearChart(`chart_${index}_${count}`);
                }
              }
            }
          });
        }
        // 指标图表的切换，预留

        if (chart) {
          chart.loading.hide();
        }
        if (!this.isInit) {
          this.isInit = true;
        }
      },
      seriesHandler(e) {
        const data = baseUtil.copy(e.data);
        this.refreshTick(data);
      },
      singleHandler(e) {
        if (this.isInit) {
          const data = baseUtil.copy(e.data);
          this.refreshTick(data);
        }
      },
      unListen(code) {
        seriesStorage.unlisten('tenDaysTick', code, this.seriesHandler);
        seriesStorage.stopPullData({
          code,
          type: 'tenDaysTick',
        });
        baseUtil.each(this.config, (item) => {
          seriesStorage.stopPullData({
            code,
            type: 'tenDaysTick',
            name: this.typeMap[item],
          });
        });
      },
    },
    activated() {
//      if (!this.chart) {
//        this.initChart();
//        this.isInit = true;
//      }
      this.initChart();
      this.getChartArea();

      const userConfig = this.config;
      seriesStorage.listen('tenDaysTick', this.code, this.seriesHandler);
      seriesStorage.pullData({
        code: this.code,
        type: 'tenDaysTick',
      });
      baseUtil.each(userConfig, (item) => {
        if (item !== '成交量') {
//          seriesStorage.listen('tick', this.code, this.typeMap[item], this.singleHandler);
          seriesStorage.pullData({
            code: this.code,
            type: 'tenDaysTick',
            name: this.typeMap[item],
          });
        }
      });
    },
    deactivated() {
      if (this.chart) {
        this.isInit = false;
        this.chart.destroy();
        delete this.chart;
//        baseUtil.each(this.config, (item) => {
//          seriesStorage.unlisten('tick', this.code, this.typeMap[item], this.singleHandler);
//        });
//        seriesStorage.unlisten('tick', this.code, 'line', this.seriesHandler);
//        seriesStorage.unlisten('tick', this.code, 'ma', this.seriesHandler);
        this.unListen(this.code);
        seriesStorage.unlisten('tenDaysTick', this.code, this.seriesHandler);
        window.removeEventListener('resize', this.getChartArea);
      }
    },
  };
</script>

